// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import '@openzeppelin/contracts-upgradeable/proxy/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import 'abdk-libraries-solidity/ABDKMath64x64.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import './characters.sol';
import './interfaces/ICharacter.sol';
import './weapons.sol';

contract Airdrop is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    ICharacter
{
    using SafeMath for uint256;
    using ABDKMath64x64 for uint256;
    using ABDKMath64x64 for int128;

    uint256 public ELITE_WEIGHTAGE;
    uint256 public TRAINEE_WEIGHTAGE;
    uint256 public WEAPON_WEIGHTAGE;
    uint256 public TOTAL_DISTRIBUTION;

    Characters public characters;
    Weapons public weapons;
    IERC20 public CORE;

    function initialize(
        Characters _characters,
        Weapons _weapons,
        address _core,
        address[] memory _earlyAdopters
    ) public initializer {
        __Context_init_unchained();
        __Ownable_init_unchained();
        __Pausable_init_unchained();

        CORE = IERC20(_core);
        characters = _characters;
        weapons = _weapons; 

        earlyAdopters = _earlyAdopters;

        ELITE_WEIGHTAGE = 25;
        TRAINEE_WEIGHTAGE = 5;
        WEAPON_WEIGHTAGE = 1;
        TOTAL_DISTRIBUTION = 1000000 ether;

    }

    uint256 public airdropStarts;
    uint256 public airdropDuration;
    uint256 public totalWeight;
    address[] public earlyAdopters;

    mapping(address => uint256[]) public snapshotCharacterIds;
    mapping(address => uint256[]) public snapshotWeaponIds;

    mapping(uint256 => bool) public claimedCharacterIds;
    mapping(uint256 => bool) public claimedWeaponIds;

    event ClaimedAirdrop(address indexed user, uint256 amount);

    modifier checkForValidAirdrop() {
        require(airdropStarts !=0, "Airdrop not started!");
        if((block.timestamp < airdropStarts.add(airdropDuration))) {
            bool isEarlyAdopter = false;
            for(uint256 i = 0; i < earlyAdopters.length; i++) {
                if(earlyAdopters[i] == msg.sender) {
                    isEarlyAdopter = true;
                }
            }
            require(isEarlyAdopter, "Not eligible for airdrop!");
        }
        _;
    }

    modifier airdropNotStarted() {
        require(airdropStarts == 0, "Airdrop already started.");
        _;
    }

    function setAirdropDuration(uint256 duration) external onlyOwner {
        airdropDuration = duration;
    }

    function setAirdropStartTime() external airdropNotStarted onlyOwner {
        airdropStarts = block.timestamp;
    }

    function setSnapshotForUsers(bool characterData, address user, uint256[] calldata ids) external airdropNotStarted onlyOwner {
        if(characterData) {
            snapshotCharacterIds[user] = ids;
        } else {
            snapshotWeaponIds[user] = ids;
        }
    }

    // function setAmounts(uint256 _ELITE_WEIGHTAGE, uint256 _TRAINEE_WEIGHTAGE, uint256 _WEAPON_WEIGHTAGE) external onlyOwner {
    //     ELITE_WEIGHTAGE = _ELITE_WEIGHTAGE;
    //     TRAINEE_WEIGHTAGE = _TRAINEE_WEIGHTAGE;
    //     WEAPON_WEIGHTAGE = _WEAPON_WEIGHTAGE;
    // }

    function setTotalWeight(uint256 _weight) external airdropNotStarted onlyOwner {
        totalWeight = _weight;
    }

    function claimAirdrop()
        public
        whenNotPaused
        checkForValidAirdrop
    {
        uint256 charactersCount = characters.balanceOf(msg.sender);
        uint256 weaponsCount = weapons.balanceOf(msg.sender);
        require(charactersCount.add(weaponsCount) > 0, "Not eligible for airdrop!");

        uint256 totalAmount = _checkClaimableAirdropAmount(msg.sender);
        require(totalAmount > 0, "No amount left to claim");
        require(CORE.balanceOf(address(this)) > totalAmount, "Not enough CORE tokens");

        require(CORE.transfer(msg.sender, totalAmount), "Unable to send airdrop tokens");
        emit ClaimedAirdrop(msg.sender, totalAmount);
    }

    function _checkClaimableAirdropAmount(address user) internal returns(uint256) {
        uint256[] memory characterIds = snapshotCharacterIds[user];
        uint256[] memory weaponIds = snapshotWeaponIds[user];

        uint256 totalAmount = 0;
        for(uint256 i=0; i<characterIds.length; i++) {
            if(!claimedCharacterIds[characterIds[i]]) {
                if(characters.getCharacterType(characterIds[i]) == CharacterType.Elite) {
                    totalAmount = totalAmount.add(ELITE_WEIGHTAGE);
                } else {
                    totalAmount = totalAmount.add(TRAINEE_WEIGHTAGE);
                }
            claimedCharacterIds[characterIds[i]] = true; 
            }
        }

        for(uint256 i=0; i<weaponIds.length; i++) {
            if(!claimedWeaponIds[weaponIds[i]]) {
                totalAmount = totalAmount.add(WEAPON_WEIGHTAGE);
                claimedWeaponIds[weaponIds[i]] = true; 
            }
        }

        return ABDKMath64x64.divu(totalAmount, totalWeight).mulu(TOTAL_DISTRIBUTION);
    }

    function checkClaimableAirdropAmount(address user) public view returns(uint256) {
        uint256[] memory characterIds = snapshotCharacterIds[user];
        uint256[] memory weaponIds = snapshotWeaponIds[user];

        uint256 totalAmount = 0;
        for(uint256 i=0; i<characterIds.length; i++) {
            if(!claimedCharacterIds[characterIds[i]]) {
                if(characters.getCharacterType(characterIds[i]) == CharacterType.Elite) {
                    totalAmount = totalAmount.add(ELITE_WEIGHTAGE);
                } else {
                    totalAmount = totalAmount.add(TRAINEE_WEIGHTAGE);
                }
            }
        }

        for(uint256 i=0; i<weaponIds.length; i++) {
            if(!claimedWeaponIds[weaponIds[i]]) {
                totalAmount = totalAmount.add(WEAPON_WEIGHTAGE);
            }
        }

        return ABDKMath64x64.divu(totalAmount, totalWeight).mulu(TOTAL_DISTRIBUTION);
    }

    // if we will really need this?
    // function addEarlyAdopters(address[] memory users) public airdropNotStarted onlyOwner {
    //     require(users.length > 0, "No addresses!");
    //     for(uint i=0; i< users.length; i++) {
    //         require(users[i] != address(0), "Address(0) error");
    //         earlyAdopters.push(users[i]);
    //     }   
    // }

    function getAllEarlyAdopters() public view returns(address[] memory) {
        return earlyAdopters;
    }

    function getUserWeapons(address user) public view returns(uint256[] memory) {
        uint256[] memory tokens = new uint256[](weapons.balanceOf(user));
        for(uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = weapons.tokenOfOwnerByIndex(user, i);
        }
        return tokens;
    }

    function getUserCharacters(address user) public view returns(uint256[] memory) {
        uint256[] memory tokens = new uint256[](characters.balanceOf(user));
        for(uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = characters.tokenOfOwnerByIndex(user, i);
        }
        return tokens;
    }

    function getUserSnapshots(bool characterData, address user) public view returns(uint256[] memory) {
        if(characterData) {
            return snapshotCharacterIds[user];
        }
        return snapshotWeaponIds[user];
    }

    function withdrawCORE(uint256 amount) public onlyOwner {
        require(CORE.balanceOf(address(this)) >= amount, "Not enough amount");
        require(CORE.transfer(msg.sender, amount), "Unable to withdraw CORE tokens");
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

}
